public void decReservedResource(String partition, Resource reservedRes) {
  if (partition == null) {
    partition = RMNodeLabelsManager.NO_LABEL;
  }

  queueUsage.decReserved(partition, reservedRes);
  if(null != parent){
    parent.decReservedResource(partition, reservedRes);
  }
}
